import Validate from "./Validate";

const AuthorizedLogin = (email, password) => {
  if (email === "" && password === "") {
    alert("Enter email and password");
  } else if (email === "") {
    alert("Insert Email");
  } else if (password === "") {
    alert("Insert Password");
  } else {
    alert("Login Successfull");
    const res = Validate(email, password);
    console.log(res);
    if (!res) {
      alert("PageNotChange");
    }
  }
};

export default AuthorizedLogin;
